class Solution:
    def numSplits(self, s: str) -> int:
        left = [0 for _ in range(26)]
        right = [0 for _ in range(26)]
        for ch in s:
            right[ord(ch)-97] += 1
        r = sum([1 for f in right if f > 0])
        l = 0
        res = 0
        for i in range(0, len(s) - 1):
            c = s[i]
            if left[ord(c) - 97] == 0:
                l += 1
            left[ord(c) - 97] += 1
            right[ord(c) - 97] -= 1
            if right[ord(c) - 97] == 0:
                r -= 1
            if l > r:
                break
            if l == r:
                res += 1
        return res

